answer_text:
Нет, цены необходимо возвращать вручную в разделе Цены https://selsup.ru/application/prices/. 
Для Вб цены можно вернуть. 

Для того, чтобы активировать функцию:
1. Перейдите в настройки (знак синей шестеренки в верхней панели экрана), вкладка Цены и Акции или в раздел Акции, вкладка Акции Wildberries;

2. Найдите поле «Возвращать цены из автоматической акции»;

3. Выберите организацию для которой активируете функцию. Можно выбрать одну организацию, несколько или все, но только по выбранным организациям SelSup будет автоматически возвращать цены. Если для какой-то организации функция неактивна, то цены, как обычно, будут приходить в SelSup с маркетплейса;

4. Нажмите «Сохранить», чтобы выбранные данные сохранились и функция стала активной.
Подробная информация о работе с акциями Вб изложена в статье:
https://selsup.ru/help/rabota-s-aktsiyami-wildberries/#kak-vozvrashhat-tseny-iz-avtomaticheskoj-aktsii

Для всех номенклатур (расцветок) в рамках одной карточки должны быть одинаковые соответствия размеров и рос. размеров, и в пределах одной номенклатуры российские размеры повторяться не могут.

При создании карточка попадет в черновик и будет возникать данная ошибка.

Чтобы устранить ошибку:
- нужно удалить в личном кабинете Wildberries карточку из черновиков (если она там есть);
- проверить в параметрах Wildberries "Рос.размер" и "Размер" стоят ли одинаковые значения;
- удалить значения в одном из этих столбцов;
- пересохранить карточку в Селсап с отправкой на маркетплейс.

Не найден товар по штрихкоду, хотя товар есть в заказе
1. Проверить есть ли данный штрихкод в заказе;
2. Правильный ли заказ вы выбрали при входе в задание упаковка ФБО;
3. Проверьте правильно ли у вас заведен штрихкод без пробелов;
4. Проверьте, что при сканировании у вас стоит английский язык на клавиатуре;
5. Работаете ли вы с комплектами? Нужно сканировать штрихкод составной части;

Если вы все проверили, однако это не помогает, обратитесь в техподдержку, сообщив:
— ссылку на заказ
— штрихкод
— сообщите включена ли галочка в задании «проверять коды маркировки».
Специалист посмотрит консоль разработчика и логи и поможет решить проблему.

Статус «золотой клиент»: 
1. Мы присваиваем статус в программ;  
2. Наши специалисты будут бороться за право решить Ваш запрос. С лояльным клиентом каждый хочет общаться; 🫶 
3. Вы будете получать более быстрые ответы от техподдержки 1 линии; 
4. Ваши обращения на 2 линию будут со значком «приоритетно»; 
5. Участвовать в фокус группах по улучшению сервиса.
